  <app-info-button text="Gemeinschaft ist eine Kraftquelle, sie ist ein wrmendes Feuer und strkende Nahrung, um durch den Tag zu kommen. Doch Nhe und Zusammensein ist schon seit so langer Zeit ein bloer Sehnsuchtsort fr viele. Deswegen bring doch die Kraft des Miteinanders zu den Menschen, die sie gerade ganz besonders brauchen. Vielleicht fllt Dir direkt jemand ein. Vielleicht ist es aber auch die nchste Person, der wir eine Freude bereiten wollen. Wo zwei oder drei zusammen sind, ist auch Gott. "></app-info-button>
